import React, { useState, useRef, useEffect, useCallback } from "react";
import ReelSet from "./components/ReelSet"
import './assets/css/App.css'

import './assets/css/App.css';

const  App=(props)=> {

const [spin, setSpin] = useState(1);

const callbackSetSpin = (spin)=>{
  console.log("My App score is: "+spin);
  setSpin(spin);
}

  return (
    <>
      <ReelSet runGame={spin} spinCallback={callbackSetSpin}/>
    </>
  );
}
export default App;
